import React, { useState } from "react";
import homeImg from "../../home.png";
import profileImg from "../../profile.png";
import writeImg from "../../write.png";
import searchImg from "../../search.png";
import profileimgImg from "../../profileimg.png";
import { Link } from "react-router-dom";

function HomePage() {
  const [cards, setCards] = useState([
    { id: 1, nickname: 'ÎãâÎÑ§ÏûÑ1', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ1', image: profileimgImg },
    { id: 2, nickname: 'ÎãâÎÑ§ÏûÑ2', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ2', image: profileimgImg },
    { id: 3, nickname: 'ÎãâÎÑ§ÏûÑ3', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ3', image: profileimgImg },
    { id: 4, nickname: 'ÎãâÎÑ§ÏûÑ4', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ4', image: profileimgImg },
    { id: 5, nickname: 'ÎãâÎÑ§ÏûÑ5', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ5', image: profileimgImg },
    { id: 6, nickname: 'ÎãâÎÑ§ÏûÑ6', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ6', image: profileimgImg },
