    { id: 8, nickname: 'ÎãâÎÑ§ÏûÑ8', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ8', image: profileimgImg }
  ]);

  return (
    <div className="container2">
      <div className="title-box-home">
        <h1 className="ft-big">ÎÇòÏùò Ï∑®Ìñ•Ï†ÄÍ≤© Î†àÏãúÌîºüî´</h1>
      </div>
      <div className="search">
