          type="text"
          placeholder="Î†àÏãúÌîº Í≤ÄÏÉâÌïòÍ∏∞"
        />
      </div>
      
      <div className="container3">
        {cards.map(card => (
          <Card 
            key={card.id}
            nickname={card.nickname} 
            recipeName={card.recipeName} 
            image={card.image} 
          />
        ))}
      </div>

      <nav>
        <div>
          <img src={homeImg} alt="Ìôà" />
          <p>Ìôà</p>
        </div>
        <div>
          <img src={profileImg} alt="MY" />
          <p>MY</p>
        </div>
        <div>
          <img src={writeImg} alt="Í∏ÄÏì∞Í∏∞" />
          <p>Í∏ÄÏì∞Í∏∞</p>
        </div>
